import { GridItem } from "./GridItem.style";

export const Login=()=>{
    return(
        <>
        <Grid cols="1fr" rows="3">
            <GridItem>
                Hey
            </GridItem>
            <GridItem>
                This seems like a stack
            </GridItem>
        </Grid>
        </>
    )
}
